import {GrArticle} from 'react-icons/gr'
import {AiFillHeart} from 'react-icons/ai'

export const tagRender = (tag) => {
        switch(tag) {
            case 'POST':
                return <GrArticle/>
            case 'COMMENT':
                return;
            case 'LIKE':
                return <AiFillHeart/>
        }
}
